// import logo from './logo.svg';
import './App.css';

function App() {
  const users = [
    {name:"John", age:15},
    {name:"Boldo", age:15},
    {name:"Chimgee", age:20},
    {name:"Dorjo", age:25},
    {name:"Bataa", age:30},
  ];
  let sum = 0;
  sum = sum + users[1].age;
  sum = sum + users[2].age;
  sum = sum + users[3].age;
  sum = sum + users[4].age;
  sum = sum + users[0].age;
  sum = sum / 5 ;


  return (
    <div className="App">
      <p>Average age:{sum}</p>
    </div>
  );
}

export default App;
